ed\n3.  They use ordinary objects as cover (they flip tables and chairs for cover!)\n4.  They toss grenades when youre in a tight area or cornered\n5.  They FAKE DEATH!\n6.  They change position as soon as you look away to reload\n7.  They swarm you from different angles/sight lines\n8.  Did I mention they feign death?\n\nNever have a played a shooter where I really felt hunted but not powerless","author":{"@type":"https://schema.org/Person","name":"@haxorinator8219","url":"https://www.youtube.com/@haxorinator8219","alternateName":"Haxor inator"},"upvoteCount":3863}]}</script><script nonce="1kZbdPbXZC6BAzQZLmu1Xw">if (window.ytcsi) {window.ytcsi.tick('bc', null, '');}</script><link rel="preload" href="https://rr2---sn-n4g-cvqk.googlevideo.com/generate_204" as="fetch"><link rel="preload" href="https://rr2---sn-n4g-cvqk.googlevideo.com/generate_204?conn2" as="fetch"><link rel="canonical" href="https://www.youtube.com/watch?v=9bbhJi0NBkk&amp;list=PLrT2fbyJrAIctd7zNUsdPakIllX2lhrzo&amp;index=21"><link rel="alternate" media="handheld" href="https://m.youtube.com/watch?v=9bbhJi0NBkk&amp;list=PLrT2fbyJrAIctd7zNUsdPakIllX2lhrzo&amp;index=21"><link rel="alternate" media="only screen and (max-width: 640px)" href="https://m.youtube.com/watch?v=9bbhJi0NBkk&amp;list=PLrT2fbyJrAIctd7zNUsdPakIllX2lhrzo&amp;index=21"><title>What Makes Good AI? - YouTube</title><meta name="title" content="What Makes Good AI?"><meta name="description" content=" Get bonus content by supporting Game Makers Toolkit - https://gamemakerstoolkit.com/support/ When we talk about good AI, we often think about highly ef..."><meta name="keywords" content="game maker&#39;s toolkit, ai, artificial intelligence, video games, alien isolation, shadow of mordor"><link rel="shortlinkUrl" href="https://youtu.be/9bbhJi0NBkk?list=PLrT2fbyJrAIctd7zNUsdPakIllX2lhrzo"><link rel="alternate" href="android-app://com.google.android.youtube/http/www.youtube.com/watch?v=9bbhJi0NBkk&amp;list=PLrT2fbyJrAIctd7zNUsdPakIllX2lhrzo&amp;
